import React from "react";

const Navbar = () => {
    return (
        <nav style={styles.navbar}>
            <div style={styles.logoContainer}>
                <h1 style={styles.logo}>ðŸŒŸ Kundalini Activation</h1>
            </div>
            <ul style={styles.navLinks}>
                <li style={styles.navItem}>
                    <a href="/" style={styles.navLink} className="nav-link">
                        Home
                    </a>
                </li>
                <li style={styles.navItem}>
                    <a href="/offerings" style={styles.navLink} className="nav-link">
                        Offerings
                    </a>
                </li>
                <li style={styles.navItem}>
                    <a href="/contact" style={styles.navLink} className="nav-link">
                        Contact
                    </a>
                </li>
            </ul>
        </nav>
    );
};

const styles = {
    navbar: {
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        padding: "15px 30px",
        background: "linear-gradient(90deg, #4b79a1, #283e51)",
        color: "white",
        boxShadow: "0 4px 10px rgba(0, 0, 0, 0.2)",
        position: "sticky",
        top: 0,
        zIndex: 1000,
    },
    logoContainer: {
        display: "flex",
        alignItems: "center",
    },
    logo: {
        fontSize: "1.8rem",
        fontWeight: "bold",
        fontFamily: "'Poppins', sans-serif",
        cursor: "pointer",
    },
    navLinks: {
        listStyle: "none",
        display: "flex",
        gap: "25px",
        margin: 0,
    },
    navItem: {
        fontSize: "1rem",
    },
    navLink: {
        textDecoration: "none",
        color: "white",
        fontSize: "1.1rem",
        fontWeight: "500",
        transition: "color 0.3s ease",
    },
};

export default Navbar;
